declare @Template varbinary(max) = 

--Загрузка файла шаблона
merge mdt.[File] as f
using (
	select
		s.Name as Name
		,s.Data as Data
		,s.Type as Type
		,newid() as UID
		,fs.ID as ID_FileStorage
		,p.ID as MDT_ID_PrincipalCreatedBy
		,getdate() as MDT_DateCreate
	from (
		values ('onboarding.ApplicationTemplate.docx', @Template, 'application/vnd.openxmlformats-officedocument.wordprocessingml.document', 'db', 'onboarding.Application')
	) as s (Name, Data, Type, FileStorage, Object)
		inner join mdt.FileStorage as fs on fs.Code = s.FileStorage
		inner join mdt.Principal as p on p.Code = 'anonymous'
) as m on m.Name = f.Name
when matched then
	update
	set
		Data = m.Data
		,Type = m.Type
		,ID_FileStorage = m.ID_FileStorage
		,MDT_ID_PrincipalCreatedBy = m.MDT_ID_PrincipalCreatedBy
		,MDT_DateCreate = m.MDT_DateCreate
when not matched then
	insert (Name, Data, Type, UID, ID_FileStorage, MDT_ID_PrincipalCreatedBy, MDT_DateCreate)
	values (m.Name, m.Data, m.Type, m.UID, m.ID_FileStorage, m.MDT_ID_PrincipalCreatedBy, m.MDT_DateCreate);

-- Получение ID_File для только что добавленного файла
declare @InsertedFileID int;
set @InsertedFileID = (
	select ID
	from mdt.[File]
	where Name = 'onboarding.ApplicationTemplate.docx'
);

--Настройка шаблона
merge docgen.Template as t
using (
	select
		s.Code as Code
		,s.Title as Title
		,@InsertedFileID as ID_File
		,mdt.ID_Object(s.Code) as ID_Object
		,cast(1 as bit) as FlagDocx
	from (
		values ('onboarding.Application', 'Заявление')
	) as s (Code, Title)
) as m on m.Code = t.Code
	and m.Title = t.Title
when matched then
	update
	set
		ID_File = m.ID_File
		,ID_Object = m.ID_Object
		,FlagDocx = m.FlagDocx
when not matched then
	insert (Code, Title, ID_File, ID_Object, FlagDocx)
	values (m.Code, m.Title, m.ID_File, m.ID_Object, m.FlagDocx);

--Настройка формата поля
insert into docgen.TemplateFieldFormat (ID_Template, FieldPath, ID_Format)
select
	t.ID as ID_Template
	,s.Field as FieldPath
	,f.ID as ID_Format
from (
	values
		('onboarding.Application', 'DateEnd', 'Date-D')
		,('onboarding.Application', 'DateBegin', 'Date-D')
		,('onboarding.Application', 'Date', 'Date-d')
) as s (Template, Field, Format)
	inner join docgen.Template as t on t.Code = s.Template
	inner join docgen.Format as f on f.Code = s.Format
	left join docgen.TemplateFieldFormat as tff on tff.ID_Template = t.ID
		and tff.FieldPath = s.Field
		and tff.ID_Format = f.ID
	where tff.ID is null

--Настройка условных блоков
merge docgen.TemplateConditionalBlock as tcb
using (
	select
		t.ID as ID_Template
		,s.FieldPath as FieldPath
		,s.Code as Code
		,s.FlagInverted as FlagInverted
	from (
		values
			('onboarding.Application', 'IsVacation', 'IsVacation_o2o/FlagVacation', 0)
			,('onboarding.Application', 'IsNotVacation', 'IsVacation_o2o/FlagVacation', 1)
	) as s (Template, Code, FieldPath, FlagInverted)
		inner join docgen.Template as t on t.Code = s.Template
) as m on m.ID_Template = tcb.ID_Template
	and m.Code = tcb.Code
when matched then
	update
	set
		FieldPath = m.FieldPath
		,FlagInverted = m.FlagInverted
when not matched then
	insert (ID_Template, Code, FieldPath, FlagInverted)
	values (m.ID_Template, m.Code, m.FieldPath, m.FlagInverted);

--Разрешение на скачивание docx
update st
set 
	FlagDocx = cast(1 as bit)
from docgen.Settings as st
